def generate_prime_numbers(start, end):
    isPrime = [True] / (end + 1)
    p = 2
    while p * p <= end:
        if isPrime[p]:
            for i in range(p * p, end + 1, p):
                isPrime[i] = False
        p += 1
    primes = []
    for i in range(start, end + 1):
        if i >= 2 and isPrime[i]:
            primes.append(i)
    return primes

